(function LoadJennyModel() {
    //MDL Registry Locations:
    // DefaultSkins.java (optional)
    // SkinPreviewRenderer.java (optional, and we don't yet have mixins)
    // SkinModel.java
    // HighPolySkin.java
    // RenderHighPoly.java (optional)
    
    const ResourceLocationClass = ModAPI.reflect.getClassByName("ResourceLocation").class;
    const ResourceLocationRaw = ModAPI.reflect.getClassByName("ResourceLocation").constructors.find(x=>x.length===1);
    const ResourceLocation = (x)=>ResourceLocationRaw(ModAPI.util.str(x));
    const jenny$HighPolySkin = ModAPI.reflect.getClassByName("HighPolySkin").constructors[0](
        ModAPI.util.str("JENNY"),
        5,
        ResourceLocation("eagler:mesh/jenny.png"),
        ResourceLocation("eagler:mesh/jenny.mdl"),
        null,
        null,
        ModAPI.array.object(ResourceLocationClass, 0),
        ModAPI.array.float(0),
        0.0,
        ResourceLocation("eagler:mesh/jenny.fallback.png")
    )
 
    const SkinModelRefClass = ModAPI.reflect.getClassByName("SkinModel");
    const jenny$SkinModel = SkinModelRefClass.constructors.find(x=>x.length===4)(ModAPI.util.str("JENNY"), 8, 8, jenny$HighPolySkin);
    SkinModelRefClass.staticVariables.skinModels.data.push(jenny$SkinModel);
    SkinModelRefClass.staticVariables.skinModelsByName.$put(ModAPI.util.str("JENNY"), jenny$HighPolySkin);

    const DefaultSkinsRefClass = ModAPI.reflect.getClassByName("DefaultSkins");
    const jenny$DefaultSkin = DefaultSkinsRefClass.constructors[0](ModAPI.util.str("JENNY"), 29, 29, ModAPI.util.str("JENNY"), ResourceLocation("eagler:mesh/jenny.fallback.png"), jenny$SkinModel); //name, id, id, name, location, model
    DefaultSkinsRefClass.staticVariables.defaultSkinsMap.data.push(jenny$DefaultSkin);

    ModAPI.addEventListener("lib:asyncsink", async () => {
        // MODEL DATA HERE
        AsyncSink.setFile("resourcepacks/AsyncSinkLib/assets/eagler/mesh/jenny.mdl", await (await fetch(`data:/octet-stream;base64,`)).arrayBuffer());
        // TEXTURE DATA HERE
        AsyncSink.setFile("resourcepacks/AsyncSinkLib/assets/eagler/mesh/jenny.png", await (await fetch(`data:image/png;base64,`)).arrayBuffer());
        // FALLBACK TEXTURE DATA HERE
        AsyncSink.setFile("resourcepacks/AsyncSinkLib/assets/eagler/mesh/jenny.fallback.png", await (await fetch(`data:image/png;base64,`)).arrayBuffer());
    });
})();
